import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";

function Expense({ expenses }) {
  return (
    <section className="expenses">
      {expenses.map((expense) => (
        <ExpenseItem
          title={expense.title}
          amount={expense.amount}
          date={expense.date}
        ></ExpenseItem>
      ))}
    </section>
  );
}

export default Expense;
